http://www.phenome-fppn.fr/diaphen/DROPS	DROught-tolerant yielding PlantS	DROPS		European	Code 125486	2010-02-01	2015-11-30	dry environments, water-use efficiency, phenotyping	DROPS aims at developing novel methods and strategies for genetic yield improvement under dry environments and for enhanced plant water-use efficiency. DROPS has received an EC contribution of 5,9 million € in the topic "Water stress tolerance and water use efficiency in food crops" The project will last 5 years starting on 1st July 2010. The DROPS Consortium involves 15 public and private partners from Europe, United States and Australia under coordination of François Tardieu from the INRA-Montpellier, France.	Genetic yield improvement under dry environments and for enhanced plant water-use efficiency		http://www6.inra.fr/dropsproject/	
